import Container from 'react-bootstrap/Container' 
import {Button, Stack} from "react-bootstrap" 


function App() { 
  return(
    <Container className="my-4"> 
    <Stack direction="horizontal" gap="2" className="mb-4"> 
      <h1 className="me-auto">  </h1>
    </Stack>
    </Container>
  )
}

export default App;
